import React from "react";
import { LineChart } from "@mui/x-charts/LineChart";

function Momentum(props) {
    const data = props.data?.content?.momentum?.main?.data
    console.log(data)

    let minutes = []
    let values = []

    data?.map((moment, index) => {
        minutes.push(moment.minute)
        values.push(moment.value)
    })

    return (
        <div className="w-full flex flex-col rounded-lg py-4 bg-white brd gap-4">
            <div className="text-center font-medium text-base px-4">Match Momentum</div>
            <div className="brd05"></div>
            <div className="h-40 md:h-72 relative">
                <LineChart
                    axisHighlight={{
                        x: "line", 
                        y: "none",
                      }}
                    xAxis={[{ data: minutes,
                        min: minutes[0],
                        max: minutes[minutes.length-1],
                        hideTooltip: true  }]}
                    series={[
                        {
                            data: values,
                            // type: "line",
                            area: true,
                            stack: "total",
                            showMark: false,
                            color: props.colorData?.home
                        },
                    ]}
                    // width={100}
                    // height={200}
                    leftAxis={null}
                    bottomAxis={null}
                />
                {/* <div className="absolute w-full bottom-12 px-4">
                    <div className="border border-dashed border-gray-200 relative w-full">
                        <div className="right-0 absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-base flex justify-center">
                            <div className="w-fit px-2 py-0.5 bg-white brd05 rounded-full font-bold">
                                HT
                            </div>
                        </div>
                    </div>
                </div> */}
                <g class="recharts-layer recharts-cartesian-axis recharts-xAxis xAxis"><line stroke-dasharray="0.0001 8.96159247311828" stroke-linecap="round" stroke-width="3" stroke="var(--GlobalColorScheme-Border-borderColor2)" height="30" orientation="bottom" width="833.4375" x="27.78125" y="254" class="recharts-cartesian-axis-line" fill="none" x1="27.78125" y1="254" x2="861.21875" y2="254"></line><g class="recharts-cartesian-axis-ticks"><g class="recharts-layer recharts-cartesian-axis-tick"><g transform="translate(27.781250000000057,248)"><g width="100%" height="100%"><defs><filter x="-0.625" y="0" width="2.25" height="1" id="breakBackground"><feFlood flood-color="var(--GlobalColorScheme-Background-card)" result="bg"></feFlood><feMerge><feMergeNode in="bg"></feMergeNode><feMergeNode in="SourceGraphic"></feMergeNode></feMerge></filter><filter x="0" y="0" width="1" height="1" id="hoverBackground"><feFlood flood-color="var(--GlobalColorScheme-Background-card)" result="bg"></feFlood><feMerge><feMergeNode in="bg"></feMergeNode><feMergeNode in="SourceGraphic"></feMergeNode></feMerge></filter></defs><g filter="url(#breakBackground)"><text dy="10" text-anchor="middle" fill="var(--GlobalColorScheme-Text-textDefault)" font-size="14" style="font-family: GTWalsheim-Bd;">0'</text></g></g></g></g><g class="recharts-layer recharts-cartesian-axis-tick"><g transform="translate(440.01915322580646,248)"><g width="100%" height="100%"><defs><filter x="-0.625" y="0" width="2.25" height="1" id="breakBackground"><feFlood flood-color="var(--GlobalColorScheme-Background-card)" result="bg"></feFlood><feMerge><feMergeNode in="bg"></feMergeNode><feMergeNode in="SourceGraphic"></feMergeNode></feMerge></filter><filter x="0" y="0" width="1" height="1" id="hoverBackground"><feFlood flood-color="var(--GlobalColorScheme-Background-card)" result="bg"></feFlood><feMerge><feMergeNode in="bg"></feMergeNode><feMergeNode in="SourceGraphic"></feMergeNode></feMerge></filter></defs><g filter="url(#breakBackground)"><text dy="10" text-anchor="middle" fill="var(--GlobalColorScheme-Text-textDefault)" font-size="14" style="font-family: GTWalsheim-Bd;">HT</text></g></g></g></g><g class="recharts-layer recharts-cartesian-axis-tick"><g transform="translate(861.21875,248)"><g width="100%" height="100%"><defs><filter x="-0.625" y="0" width="2.25" height="1" id="breakBackground"><feFlood flood-color="var(--GlobalColorScheme-Background-card)" result="bg"></feFlood><feMerge><feMergeNode in="bg"></feMergeNode><feMergeNode in="SourceGraphic"></feMergeNode></feMerge></filter><filter x="0" y="0" width="1" height="1" id="hoverBackground"><feFlood flood-color="var(--GlobalColorScheme-Background-card)" result="bg"></feFlood><feMerge><feMergeNode in="bg"></feMergeNode><feMergeNode in="SourceGraphic"></feMergeNode></feMerge></filter></defs><g filter="url(#breakBackground)"><text dy="10" text-anchor="middle" fill="var(--GlobalColorScheme-Text-textDefault)" font-size="14" style="font-family: GTWalsheim-Bd;">FT</text></g></g></g></g></g></g>
            </div>
        </div>
    )
}

export default Momentum

